import React from "react";
// import ReactDom from "react-dom";

ReactDom.render(
  <>
    <h1>My favourite Fruits</h1>
    <ul>
      <li>Apple</li>
      <li>Banana</li>
      <li>Orange</li>
    </ul>
  </>,
  document.getElementById("root")
);
